import React from 'react';
import classes from './Navbar.module.css';
import { NavLink } from 'react-router-dom';

const Navbar = (props) => {
    return(
        <nav className={classes.main}>
            <NavLink to="/">
                <div className={classes.logo}></div>
                Brand
            </NavLink>


        </nav>
    )
}

export default Navbar;
